import React,{ useState } from 'react';
import './App.css';

function App() {
   const[activeTab,setActiveTab]= useState('image-generator');
   const handleTabChange=(tab)=>{
    alert(tab)
    setActiveTab(tab)
   }

  return (
    <div className="App">
      <button onClick={()=>handleTabChange}>Image Generator</button>
      <button>Chat</button>
      <button>Receipe Generator</button>
    </div>
  );
}

export default App;
